import React, { useEffect, useState } from "react";
import axios from "axios";
import config from "../config.json";
import "./Stream.css";
import { Col, Row, Container, Card, Button } from "react-bootstrap";

const Stream = () => {
    const [streamUrl] = useState(null);

    const getPlaylist = () => {
        // try {
        //     const data = await axios.get(config.api.url + "/streams/playlists")
        //     console.log(data)
        // } catch (error) {
        //     console.log(error)
        // }

        axios
            .get(config.api.url + "/streams/playlists", {
                headers: {
                    Authorization:
                        "eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJlbWFpbF9pZCI6ImhyaXRoaWtnYXZhbmthcjg1ODJAZ21haWwuY29tIiwiaWF0IjoxNjM4Njc4MDUyLCJleHAiOjE2Mzg2ODE2NTJ9.VRKYDpncFxpvXRDMeAlMql1XHBMAZPJNCBppknEtan8",
                },
            })
            .then((res) => {
                console.log(res.data);
            });
    };

    // const getRecents = () => {
    //     axios
    //         .get(config.api.url + "/streams/recent", {
    //             headers: {
    //                 Authorization:
    //                     "eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJlbWFpbF9pZCI6ImhyaXRoaWtnYXZhbmthcjg1ODJAZ21haWwuY29tIiwiaWF0IjoxNjM4Njc4MDUyLCJleHAiOjE2Mzg2ODE2NTJ9.VRKYDpncFxpvXRDMeAlMql1XHBMAZPJNCBppknEtan8",
    //             },
    //         })
    //         .then((res) => {
    //             console.log(res.data);
    //         });
    // };

    useEffect(() => {
        if (streamUrl) window.location.href = streamUrl;
    }, [streamUrl]);

    return (
        <div id="stream-page">
            <Container>
                <Row>
                    <Col>
                        <Card id="stream-card" style={{ width: "20rem" }}>
                            {/* <Card.Img variant="top" src="holder.js/100px180" /> */}
                            <Card.Body>
                                <Card.Title>Playlists</Card.Title>
                                <Button variant="primary" onClick={() => getPlaylist}>Get Playlist</Button>
                            </Card.Body>
                        </Card>
                    </Col>

                    <Col>
                        <Card id="stream-card" style={{ width: "18rem" }}>
                            <Card.Body>
                                <Card.Title>Recents</Card.Title>
                                <Button variant="primary" >Get Recents</Button>
                            </Card.Body>
                        </Card>
                    </Col>
                </Row>
            </Container>
        </div>
    );
};

export default Stream;




